import Flickity from "react-flickity-component";
import "./flickity.css";
import cl from "./Carousel.module.css";
import p1 from "../../../assets/images/Carousel/1.webp";
import p2 from "../../../assets/images/Carousel/2.webp";
import p3 from "../../../assets/images/Carousel/3.webp";
import p4 from "../../../assets/images/Carousel/4.webp";
import p5 from "../../../assets/images/Carousel/5.webp";

const imgs = [p1,p2,p3,p4,p5];

const flickityOptions = {
  initialIndex: 2,
  wrapAround: true,
  autoPlay: true,
  prevNextButtons: false
};

const Carousel = () => {
  return (
    <div className={cl.slider}>
      <Flickity
        className="slider"
        elementType="div"
        disableImagesLoaded={false}
        options={flickityOptions}
        reloadOnUpdate
        static
      >
        {}
      </Flickity>
    </div>
  );
};

export default Carousel;
